(25,	'1f089b1d2de94969aca7eb9d88fd5b56',	'notes',	4,	0,	'Auf dieser Liste werden alle per Bilanzstichtag gestellten und nicht bezahlten Kunden-\nrechnungen aufgeführt. Bis zum Abschlussdatum erhaltene Teilzahlungen sind separat\naufzuführen.\nDer Rechnungsbetrag ist inklusive Mehrwertsteuer aufzuführen. Bitte vergessen Sie nicht\nden Mehrwertsteuer-Satz anzugeben. Eventuelle Abweichungen müssen speziell ge-\nkennzeichnet werden (z.B. ohne MWST).\nDamit die Bonität der Forderungen ermittelt werden kann, ergänzen Sie die Liste bitte mit\ndem Zahlungsdatum im Folgejahr.',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
(26,	'1f089b1d2de94969aca7eb9d88fd5b56',	'placeholder',	4,	0,	'true',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
(29,	'39028080c4b14f7ab33633c03f462312',	'placeholder',	4,	0,	'true',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
(31,	'5ce5acae00bc472a87f65771564836da',	'placeholder',	4,	0,	'true',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
(34,	'4e6e97c28f3b4629901dcfdf87c402d2',	'notes',	4,	0,	'Unter den Aktiven Rechnungsabgrenzungen sind Zahlungen aufzuführen, die geleistet\nworden sind, aber das neue Geschäftsjahr betreffen, wie z.B. vorausbezahlte\nVersicherungsprämien oder offene Mietzinsguthaben.\nEbenfalls aufzuführen sind Guthaben, welche im Folgejahr eintreffen, aber noch das alte\nGeschäftsjahr betreffen, wie z.B. Guthaben Schlussabrechnungen AHV, SUVA, etc.',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
(43,	'4154520809e34c409e6cec36286640ae',	'placeholder',	4,	0,	'true',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
