(92,	'0862b4b8cf26470bad04c7bd0b981426',	'notes',	4,	0,	'Auf der Liste der Verbindlichkeiten sind sämtliche noch nicht bezahlten Lieferanten- und\nUnkostenrechnungen aufzulisten, die das vergangene Geschäftsjahr betreffen. Auch\nRechnungen, die erst im Folgejahr eintreffen oder ein Datum des neuen Geschäftsjahres\naufweisen, jedoch noch das alte Geschäftsjahr betreffen, sind aufzulisten.\nDer Rechnungsbetrag ist inkl. Mehrwertsteuer aufzuführen. Bitte vergessen Sie nicht den\nMehrwertsteuer-Satz anzugeben.',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
(93,	'0862b4b8cf26470bad04c7bd0b981426',	'placeholder',	4,	0,	'true',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
