(99,	'21cbbba205d941e3b3ee82616cd5fcb7',	'placeholder',	4,	0,	'true',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
(100,	'9eb107911eec4e9f9c77f49b71f550d8',	'placeholder',	4,	0,	'true',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
(109,	'83acff93e53e4acfb330bca83aa6e139',	'notes',	4,	0,	'Unter dieser Position sind diejenigen Verbindlichkeiten einzusetzen, die das vergangene\nGeschäftsjahr betreffen, für die aber noch keine Rechnungen vorliegen, wie z.B.\nSchlussabrechnungen der AHV, SUVA, usw. Die Beträge müssen demzufolge geschätzt\nwerden. Sind sie genau bekannt, werden sie in den Verbindlichkeiten aufgeführt.\nErträge, welche im laufenden Jahr eingehen, aber für das neue Jahr bestimmt sind, sind\nebenfalls als Passive Rechnungsabgrenzung abzugrenzen.',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
(110,	'83acff93e53e4acfb330bca83aa6e139',	'placeholder',	4,	0,	'true',	NULL,	'1970-01-01 00:00:00',	NULL,	0,	1,	NULL),
